import React from "react";
import { useSelector } from "react-redux";

const PredictedLabelsButtons = () => {
  const predictedLabels = useSelector((state) => state.predictedLabels);

  const handleSearch = (labels) => {
    const keywords = labels.join("+");
    const searchUrl = `https://search.wemakeprice.com/search?search_cate=&keyword=${encodeURIComponent(
      keywords
    )}`;
    window.open(searchUrl, "_blank");
  };

  return (
    <div>
      {predictedLabels && predictedLabels.length > 0 ? ( // 조건문 추가
        predictedLabels.map((label, index) => (
          <button key={index} onClick={() => handleSearch(label.labels)}>
            {label.labels.join(", ")} ({label.probability.toFixed(2)})
          </button>
        ))
      ) : (
        <p>예측 결과가 없습니다.</p> // 예측 결과가 없는 경우 출력할 내용
      )}
    </div>
  );
};

export default PredictedLabelsButtons;
